// --- src/App.js ---
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Outlet } from 'react-router-dom';
import { useAuth } from './context/AuthContext';

// Common Components
import Navbar from './component/common/Navbar.js';

// Page Components
import HomePage from './component/pages/Home';
import LoginPage from './component/Page/Customer_Dash'; // Login/Customer Dashboard Entry
import RegistrationPage from './component/Page/Registration';
import JobApplicationForm from './component/Page/JobApplicationForm.js';
// *** KEEP THESE IMPORTS ***
import UnauthorizedPage from './component/pages/UnauthorizedPage'; // Import the component
import NotFoundPage from './component/pages/NotFoundPage';       // Import the component

// Customer Pages (Protected)
import Header from './component/Page/Header'; // Customer dashboard
import TransferMoney from './component/Page/TransferMoney';
import CheckBalancePage from './component/Page/CheckBalance';
import TransactionHistoryPage from './component/Page/TransactionHistoryPage';

// Admin Pages (Protected)
import AdminDashboardPage from './component/Page/Admin/AdminDashboardPage';
import PendingApprovalsPage from './component/Page/Admin/PendingApprovaslPage.js';
import AdminApplicationsListPage from './component/Page/Admin/AdminApplicationsListPage';
import AdminApplicationDetailPage from './component/Page/Admin/AdminApplicationDetailPage';

// Employee Pages (Protected)
import EmployeeDashboardPage from './component/Page/Employee/EmployeeDashboardPage';
import EmployeeDepositPage from './component/Page/Employee/EmployeeDepositPage';
import EmployeeWithdrawalPage from './component/Page/Employee/EmployeeWithdrawalPage';
import EmployeeCheckBalancePage from './component/Page/Employee/EmployeeCheckBalancePage';

import 'bootstrap/dist/css/bootstrap.min.css';
import { ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import theme from './styles/theme';
import './styles/global.css';

const ProtectedRoute = ({ allowedRoles }) => {
    // ... (ProtectedRoute code remains the same)
    const { authState } = useAuth();
    console.log("ProtectedRoute Check:", { isLoggedIn: authState.isLoggedIn, userRole: authState.userRole, allowedRoles });

    if (!authState.isLoggedIn) {
        return <Navigate to="/login" replace />;
    }

    if (allowedRoles && allowedRoles.length > 0 && !allowedRoles.includes(authState.userRole)) {
        console.warn(`Access Denied: Route requires [${allowedRoles.join(', ')}], user has '${authState.userRole}'`);
        return <Navigate to="/unauthorized" replace />;
    }

    return <Outlet />;
};

function App() {
    const { authState } = useAuth();

    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Router>
                <Navbar />
                <Routes>
                    {/* --- Public Routes --- */}
                    <Route path="/" element={<HomePage />} />
                    <Route path="/login" element={authState.isLoggedIn ? <Navigate to={
                        authState.userRole === 'ROLE_ADMIN' ? '/admin/dashboard' :
                        authState.userRole === 'ROLE_EMPLOYEE' ? '/employee/dashboard' :
                        '/header'
                    } replace /> : <LoginPage />} />
                    <Route path="/register" element={<RegistrationPage />} />
                    <Route path="/apply" element={<JobApplicationForm />} />
                    {/* *** USE THE IMPORTED COMPONENTS *** */}
                    <Route path="/unauthorized" element={<UnauthorizedPage />} />
                    <Route path="*" element={<NotFoundPage />} />

                    {/* --- Customer Routes --- */}
                    <Route element={<ProtectedRoute allowedRoles={['ROLE_USER', 'ROLE_ADMIN', 'ROLE_EMPLOYEE']} />}>
                        <Route path="/header" element={<Header />} />
                        <Route path="/transfer" element={<TransferMoney />} />
                        <Route path="/check-balance" element={<CheckBalancePage />} />
                        <Route path="/history" element={<TransactionHistoryPage />} />
                    </Route>

                    {/* --- Admin Routes --- */}
                    <Route element={<ProtectedRoute allowedRoles={['ROLE_ADMIN']} />}>
                        <Route path="/admin/dashboard" element={<AdminDashboardPage />} />
                        <Route path="/admin/pending" element={<PendingApprovalsPage />} />
                        <Route path="/admin/applications" element={<AdminApplicationsListPage />} />
                        <Route path="/admin/applications/:appId" element={<AdminApplicationDetailPage />} />
                    </Route>

                    {/* --- Employee Routes --- */}
                    <Route element={<ProtectedRoute allowedRoles={['ROLE_EMPLOYEE', 'ROLE_ADMIN']} />}>
                        <Route path="/employee/dashboard" element={<EmployeeDashboardPage />} />
                        <Route path="/employee/deposit" element={<EmployeeDepositPage />} />
                        <Route path="/employee/withdraw" element={<EmployeeWithdrawalPage />} />
                        <Route path="/employee/check-balance" element={<EmployeeCheckBalancePage />} />
                    </Route>

                    {/* The catch-all "*" route now correctly uses the imported NotFoundPage */}

                </Routes>
            </Router>
        </ThemeProvider>
    );
}

// *** REMOVE THE INLINE DEFINITIONS FROM HERE ***
// // Simple Placeholder Pages (Create these files)
// // src/component/pages/UnauthorizedPage.js
// const UnauthorizedPage = () => ... // REMOVED
// // src/component/pages/NotFoundPage.js
// const NotFoundPage = () => ... // REMOVED


export default App;
